fn load_stdin() -> io::Result<String> {
    log::trace!("In load_stdin");

    if atty::is(Stream::Stdin) {
        return Err(io::Error::new(io::ErrorKind::Other, "stdin not redirected"));
    }
    let mut buffer = String::new();
    io::stdin().read_to_string(&mut buffer)?;
    return Ok(buffer);
}

fn init_logging() {
    let path = format!("{}/{}", read_lock!(CONFIG).dev.debug_dir, "debug.log");
    let log_file = File::create(path).expect("Could not create log file");

    Dispatch::new()
        .level(LevelFilter::Off)
        .level_for("parversion", LevelFilter::Trace)
        .chain(stdout())
        .chain(log_file)
        .apply()
        .expect("Could not initialize logging");
}



fn jaccard_similarity(set_a: &HashSet<u64>, set_b: &HashSet<u64>) -> f64 {
    let intersection: HashSet<_> = set_a.intersection(set_b).collect();
    let union: HashSet<_> = set_a.union(set_b).collect();

    if union.is_empty() {
        return 1.0;
    }

    intersection.len() as f64 / union.len() as f64
}





struct TestProvider;

#[async_trait]
impl Provider for TestProvider {

    async fn get_document_profile(&self, features: &HashSet<u64>) -> Result<Option<&DocumentProfile>, Errors> {
        log::trace!("In get_document_profile");


        let serialized_features = serde_json::to_string(features).expect("could not serialize");
        log::debug!("{}", serialized_features);


        let document_profile = DOCUMENT_PROFILES.iter().find(|item| {
            let similarity = jaccard_similarity(features, &item.features);

            log::debug!("id: {}", item.id.to_string());
            log::debug!("similarity: {}", similarity);

            similarity > 0.8
        });

        Ok(document_profile)
    }

}









#[tokio::main]
async fn main() {
    init_logging();

    let mut document = String::new();

    match load_stdin() {
        Ok(stdin) => {
            document = stdin;
        }
        Err(_e) => {
            log::debug!("Did not receive input from stdin");
        }
    }

    let matches = App::new("parversion")
        .arg(Arg::with_name("file")
             .short('f')
             .long("file")
             .value_name("FILE")
             .help("Provide file as document for processing"))
        .arg(Arg::with_name("basis")
             .short('b')
             .long("basis")
             .value_name("BASIS")
             .help("Provide basis graph"))
        .arg(Arg::with_name("format")
            .short('o')
            .long("output-format")
            .value_name("FORMAT")
            .help("Set output format: JSON, HTML, XML, text"))
        .arg(Arg::with_name("url")
            .short('u')
            .long("url")
            .value_name("URL")
            .help("The full URL that identifies and locates the provided document"))
        .get_matches();

    let origin: Option<String> = matches.value_of("url").map(|s| s.to_string());



    let context = Context::new().unwrap();
    let value = context.eval("1 + 2").unwrap();
    assert_eq!(value, JsValue::Int(3));







    let provider = TestProvider;

    let options = Options {
        origin,
        ..Options::default()
    };



    let analysis = match matches.value_of("file") {
        Some(path) => {
            normalization::normalize_file_to_analysis(
                &provider,
                path,
                &Some(options),
            ).await.expect("Could not normalize file")
        }
        None => {
            log::info!("File not provided");
            normalization::normalize_text_to_analysis(
                &provider,
                document,
                &Some(options),
            ).await.expect("Could not normalize text")
        }
    };



    let basis_graph = analysis.build_basis_graph();



    let document_format = document_format::DocumentFormat::default();


    let normalized_text = analysis.to_document(&Some(document_format)).expect("Could not convert to document").to_string();


    println!("{}", normalized_text);





    unimplemented!()
}





















